INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150703855500', '4116901', '网络无响应', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150703855501', '34400', '请求中的语法错误。Reason-Phrase应当标志这个详细的语法错误，比如”Missing Call-ID header field”', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244110', '34401', '请求需要用户认证', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244111', '34403', '服务端支持这个请求，但是拒绝执行请求。增加验证信息是没有必要的，并且请求应当不被重试', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244112', '34404', '服务器返回最终信息：用户在Request-URI指定的域上不存在。当Request-URI的domain和接收这个请求的domain不匹配的情况下， 也会产生这个应答。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244113', '34405', '服务器支持Request-Line中的方法，但是对于这个Request-URI中的地址来说，是不允许应用这个方法的。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244114', '34406', '请求中的资源只会导致产生一个在请求中的Accept头域外的，内容无法接收的错误。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244115', '34407', '这个返回码和401（Unauthorized）很类似，但是标志了客户端应当首先在proxy上通过认证。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244116', '34408', '在一段时间内，服务器不能产生一个终结应答，例如，如果它无法及时决定用户的位置。客户端可以在稍后不更改请求的内容然后重新尝试请求。', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244117', '34410', '请求的资源在本服务器上已经不存在了，并且不知道应当把请求转发到哪里。这个问题将会使永久性的。如果服务器不知道，或者不容易检测，这个资源消失是临时性质的还是永久性质的，那么应当返回一个404（Not Found）。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244118', '34413', '请求实体过大。服务器拒绝处理请求，因为这个请求的实体超过了服务器希望或者能够处理的大小。这个服务器应当关闭连接避免客户端重发这个请求。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244119', '34414', '服务器拒绝这个请求，因为Request-URI超过了服务器能够处理的长度。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244120', '34415', '服务器由于请求的消息体的格式本服务器不支持，所以拒绝处理这个请求。这个服务器必须根据内容的故障类型，返回一个Accept，Accpet-Encoding,或者Accept-Language头域列表。UAC根据8.1.3.5节定义的方法处理这个应答。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244121', '34416', '服务器由于不支持Request-URI中的URI方案而终止处理这个请求。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244122', '34420', '服务器不知道在请求中的Proxy-Require或者Require头域所指出的协议扩展。服务器必须在Unsupported头域中列出不支持的扩展。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244123', '34421', 'UAS需要特定的扩展来处理这个请求，但是这个扩展并没有在请求的Supported头域中列出。具有这个应答码的应答必须包含一个Require头域列出所需要的扩展。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244124', '34423', '服务器因为在请求中设置的资源刷新时间（或者有效时间）过短而拒绝请求。这个应答可以用于注册服务器来拒绝那些Contact头域有效期过短的注册请求。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244125', '34480', '请求成功到达被叫方的终端系统，但是被叫方当前不可用（例如，没有登陆，或者登陆了但是状态是不能通讯，或者有”请勿打扰”的标记）。应答应当在Retry-After中标志一个合适的重发时间。这个用户也有可能在其他地方是有效的（在本服务器中不知道）。Reason-Phrase(原因短句)应当提示更详细的原因，为什么被叫方暂时不可用。这个值应当是可以被UA设置的。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150712244126', '34481', '这个状态表示了UAS接收到请求，但是没有和现存的对话或者事务匹配。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632735', '34482', '服务器检测到了一个循环', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632736', '34483', '服务器接收到了一个请求包含的Max-Forwards头域是0', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632737', '34484', '服务器接收到了一个请求，它的Request-URI是不完整的。在原因短语中应当有附加的信息说明。这个状态码可以和拨号交叠。在和拨号交叠中，客户端不知道拨号串的长度。它发送增加长度的字串，并且提示用户输入更多的字串，直到不在出现484（Address Incomplete）应答为止。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632738', '34485', 'Request-URI是不明确的。应答可以在Contact头域中包含一个可能的明确的地址列表。这个提示列表可能会在安全性和隐私性对用户或者组织造成破坏。必须能够由配置决定是否以404（NotFound）代替这个应答，又或者禁止对不明确的地址使用可能的选择列表。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632739', '34486', '当成功联系到被叫方的终端系统，但是被叫方当前在这个终端系统上不能接听这个电话，那么应答应当回给呼叫方一个更合适的时间在Retry-After头域重试。这个用户也许在其他地方有效，比如电话邮箱系统等等。如果我们知道没有其他终端系统能够接听这个呼叫，那么应当返回一个状态码600（Busy Everywhere）', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632740', '34487', '请求被BYE或者CANCEL所终止。这个应答永远不会给CANCEL请求本身回复(回复的是INVITE)。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632741', '34488', '这个应答和606（Not Acceptable）有相同的含义，但是只是应用于Request-URI所指出的特定资源不能接受，在其他地方请求可能可以接受。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632742', '34491', '在同一个对话中，UAS接收到的请求有一个依赖的请求正在处理。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632743', '34493', 'UAS接收到了一个请求，包含了一个加密的MIME,并且不知道或者没有提供合适的解密密钥。这个应答可以包含单个包体，这个包体包含了合适的公钥，这个公钥用于给这个UAS通讯中加密包体使用的。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632744', '34500', '服务器遇到了未知的情况，并且不能继续处理请求。客户端可以显示特定的错误情况，并且可以在几秒种以后重新尝试这个请求。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632745', '34501', '服务器没有实现相关的请求功能。当UAS不认识请求的方法的时候，并且对每一个用户都无法支持这个方法的时候，应当返回这个应答。（proxy不考虑请求的方法而转发请求）。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632746', '34502', '如果服务器，作为gateway或者proxy存在，从下行服务器上接收到了一个非法的应答（这个应答对应的请求是本服务器为了完成请求而转发给下行服务器的）。', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632747', '34503', '由于临时的过载或者服务器管理导致的服务器暂时不可用。这个服务器可以在应答中增加一个Retry-After来让客户端重试这个请求。如果没有Retry-After指出，客户端必须就像收到了一个500（Server Internal Error）应答一样处理。客户端（proxy或者UAC）收到503（Service Unavailable）应当尝试转发这个请求到另外一个服务器处理。并且在Retry-After头域中指定的时间内，不应当转发其他请求到这个服务器。
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632748', '34504', '服务器在一个外部服务器上没有收到一个及时的应答。这个外部服务器是本服务器用来访问处理这个请求所需要的。如果从上行服务器上收到的请求中的Expires头域超时，那么应当返回一个408（Request TimeOut）错误。', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632749', '34505', '服务器不支持对应的SIP版本。服务器是无法处理具有客户端提供的相同主版本号的请求，就会导致这样的错误信息。', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632750', '34513', '服务器无法处理请求，因为消息长度超过了处理的长度。', 'S1_MME', '2');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632751', '34600', '成功联系到被叫方的终端系统，但是被叫方处于忙的状态，并不打算接听电话。这个应答可以通过增加一个Retry-After头域更明确的告诉呼叫方多久以后可以继续呼叫。如果被叫方不希望提示拒绝的原因，被叫方应当使用603（Decline）。只有当终端系统知道没有其他终端节点（比如语音邮箱系统）能够访问到这个用户的时候才能使用这个应答。否则应当返回一个486（Busy Here）的应答。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150720632752', '34603', '当成功访问到被叫方的设备，但是用户明确的不想应答。这个应答可以通过增加一个Retry-After头域更明确的告诉呼叫方多久以后可以继续呼叫。只有当终端知道没有其他任何终端设备能够响应这个呼叫的势能才能给出这个应答。', 'S1_MME', '1');
INSERT INTO "gem_session_failure_causes" ("id", "code", "description", "network_interface", "abnormal_type") VALUES ('1349852150729021361', '34604', '服务器验证了在请求中Request-URI的用户信息，哪里都不存在', 'S1_MME', '1');
